import React from 'react'
import './MainContent.css'
import {XYPlot, LineSeries, VerticalGridLines, HorizontalGridLines, YAxis, XAxis} from 'react-vis';
import '/Users/kamil/Desktop/Programowanie/ygo/node_modules/react-vis/dist/style.css';


function MainContent() {

    const data = [
        {x: "test", y: 8},
        {x: 1, y: 5},
        {x: 2, y: 4},
        {x: 3, y: 9},
        {x: 4, y: 1},
        {x: 5, y: 7},
        {x: 6, y: 6},
        {x: 7, y: 3},
        {x: 8, y: 2},
        {x: 9, y: 0}
      ];



    return (
<div className="test">
<XYPlot height={300} width= {300}>
  <LineSeries data={data} />
  <VerticalGridLines />
  <HorizontalGridLines />
  <XAxis />
  <YAxis />
</XYPlot>
</div>

    )
}

export default MainContent
